import React from 'react';

const Voice = () => {
  const voices = ['Willow', 'Atlas', 'Daniel', 'Ester'];
  
  return (
    <div className="voice-container">
      <h2>Voice</h2>
      <div className="voice-options">
        {voices.map((voice, index) => (
          <div key={index}>
            <img src="/favicon.ico" alt={voice} />
            <p>{voice}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Voice;
